import React, { Component } from "react"
import PropTypes from "prop-types"
import { withRouter } from "react-router-dom"
import { connect } from "react-redux"
import MetaTags from 'react-meta-tags';
import { withTranslation } from "react-i18next"
import Breadcrumbs from "../../../components/Common/Breadcrumb"
import CampaignData from "./Campaign-data"
import classnames from "classnames"
import {
    Row,
    Col,
    CardBody,
    Card,
    CardText,
    Container,
    Nav,
    NavItem,
    NavLink,
    TabContent,
    TabPane,
    FormGroup,
    Label,
    Input,
    Button
  } from "reactstrap"

class Campaign extends Component {
    constructor(props) {
        super(props)
        this.state = {
            activeTab: "1",
            verticalActiveTab: "1"
        }
      }
      toggle(tab) {
        if (this.state.activeTab !== tab) {
          this.setState({
            activeTab: tab,
          })
        }
      }
      render() {
        return (
          <React.Fragment>
              <div className="page-content">

                <MetaTags>
                <title>Campaigns | Realty Space</title>
                </MetaTags>
                <Container fluid>
                {/* Render Breadcrumbs */}
                <Breadcrumbs title={this.props.t("Projects")} breadcrumbItem={this.props.t("Campaigns")} />
                <Row>
                    <Col md="12">
                        <CampaignData />
                    </Col>
                </Row>
                <Row>
                    <Col lg="12">
                        <Card>
                        <CardBody>
                            <Nav tabs>
                                <NavItem>
                                <NavLink
                                    style={{ cursor: "pointer" }}
                                    className={classnames({
                                        active: this.state.activeTab === "1",
                                    })}
                                    onClick={() => {
                                        this.toggle("1")
                                    }}
                                    >
                                    {this.props.t("Integration")}
                                </NavLink>
                                </NavItem>
                                <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "2",
                          })}
                          onClick={() => {
                            this.toggle("2")
                          }}
                        >
                          {this.props.t("Send Emails")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "3",
                          })}
                          onClick={() => {
                            this.toggle("3")
                          }}
                        >
                          {this.props.t("Current Prospects")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "4",
                          })}
                          onClick={() => {
                            this.toggle("4")
                          }}
                        >
                          {this.props.t("SRR filled")}
                        </NavLink>
                      </NavItem>
                      <NavItem>
                        <NavLink
                          style={{ cursor: "pointer" }}
                          className={classnames({
                            active: this.state.activeTab === "5",
                          })}
                          onClick={() => {
                            this.toggle("5")
                          }}
                        >
                          {this.props.t("Client")}
                        </NavLink>
                      </NavItem>
                            </Nav>
                            <TabContent activeTab={this.state.activeTab} className="p-3 text-muted">
                                <TabPane tabId="1">
                                   
                                        <h4 className="card-title mb-4">All Integrations <a href="#" className="btn btn-danger waves-effect waves-light btn-sm float-end"><i className="mdi mdi-plus ml-1"></i> New Integration</a></h4>

                                       

                                </TabPane>
                                <TabPane tabId="2">
                                <h4 className="card-title mb-4">Sent Emails</h4>
                                    
                                </TabPane>
                                <TabPane tabId="3">
                                <h4 className="card-title mb-4">Prospect <a href="#" className="btn btn-danger waves-effect waves-light btn-sm float-end"><i className="mdi mdi-plus ml-1"></i> Add New Prospect </a></h4>
                                    
                                </TabPane>
                                <TabPane tabId="4">
                                <h4 className="card-title mb-4">Prospect <a href="#" className="btn btn-danger waves-effect waves-light btn-sm float-end"><i className="mdi mdi-plus ml-1"></i> Add New Prospect </a></h4>
                                    
                                </TabPane>
                                <TabPane tabId="5">

                                    
                                </TabPane>
                            </TabContent>
                        </CardBody>
                        </Card>
                    </Col>
                </Row>
                </Container>
            </div>
          </React.Fragment>
        )
      }
}

Campaign.propTypes = {
    t:PropTypes.any
  }
export default connect( )(withRouter(withTranslation()(Campaign)))
